import './Show.css';



const Show = () => {
  // đặt độ rộng cho từng cột trong table
  const cellWidth = {
    column1: '10%', // Độ rộng cho cột 1
    column2: '60%', 
    column3: '30%'
  };

  

  return (
    <div>
      <div>
        <h1>Danh sách các bài báo trong Dân trí</h1>
        <br></br>
      </div>
    <table>
            <thead>
              <tr>
                <th style={{  width: cellWidth.column1 }}>STT</th>
                <th style={{  width: cellWidth.column2 }}>Tên file</th>
                <th style={{  width: cellWidth.column3 }}>Hành động</th>
         
              </tr>
            </thead>
            <tbody>
          
            <tr >
              <td style={{ width: cellWidth.column1 }}>1</td>
              <td style={{ width: cellWidth.column2 }}>tin tức ngày 17/8/2023</td>
              <td style={{ width: cellWidth.column3 }}>
                <button className='XoaButton' >Xóa</button>
                <button className='ShowButton'>Mở</button>
              </td>
            </tr>

        </tbody>
          </table>
         
          </div>
  );
};

export default Show;
